COMPONENT.script:
			initialize()=
declare 
    tvf = TreeViewField default null;
    t = Tree;
    r = TreeNode;
    n = TreeNode;
    tn = TreeNode;
    a = array of ReposTestObject;
    i = integer not null default 1;
    comp = ReposTestObject;
    copy_n = TreeNode;
enddeclare
begin
	tvf = FIELD(repos_tree); 
	tvf.IsUnderlined = FALSE;
	t = tvf.Tree;
	tvf.ImageList[1] = FIELD(pic_blank).Image;
	tvf.ImageList[2] = FIELD(pic_success).Image;
	tvf.ImageList[3] = FIELD(pic_fail).Image;

	i=1;
	SELECT a[i].Name = e.entity_name, a[i].Id = e.base_entity_id, a[i].Type=''
	FROM ii_entities e, ii_applications a, ii_incl_apps i
	WHERE e.entity_type = 'appsource'
	AND e.version_number=-1
	AND e.entity_id = a.entity_id
	AND e.entity_id = i.app_id
	AND lowercase(i.incl_name)='unittestframework'
	AND lowercase(e.entity_name)!=lowercase(:CurFrame.ObjectSource.ParentApplication.Name)
	ORDER BY 1
	BEGIN
		i=i+1;
	END;
	if t.RootNode is not null then
		t.DeleteNode(node = t.RootNode, allnodes = TRUE);
	endif;
	r = t.AddNode(name = 'All Applications', keylabel = 'root'); 
	for i = 1 to a.LastRow do 
		n = t.AddNode(name = a[i].name, 
			keylabel = varchar(a[i].id), 
			relative = r, relation = TN_LASTCHILD); 
		n.ClientData = a[i]; 
		n.HasChildren = TRUE;
		n.IsVisible = TRUE;
		n.IsBold = TRUE;

		SELECT comp.Name = e.entity_name, comp.Id = e.entity_id
		FROM ii_entities e, ii_components c
		WHERE folder_id = :a[i].Id
		AND e.entity_id = c.entity_id
		AND LOWERCASE(c.data_type) IN ('test', 'testcase')
		AND e.version_number=-1
		AND e.entity_type = 'classsource'
		BEGIN
			tn = t.AddNode(name = varchar(comp.Name),
				relative = n, relation = TN_LASTCHILD);
			comp.Type = a[i].Name; // Application Name
			tn.ClientData = comp;
			comp = ReposTestObject.Create(); 
		END;
	endfor;
	COMMIT;
end

on click runtests_btn =
declare 
	n = TreeNode default null; 
	cache = DBCACHE;
	lockb = LOCKBLOCK;	
	appsrc = AppSource DEFAULT NULL;
	appsrc_arr = ARRAY OF AppSource;
	appcnt = INTEGER NOT NULL;
	cls_arr = ARRAY OF StringObject;
	clscnt  = INTEGER NOT NULL;
	dexp = DynExpr DEFAULT NULL;
	ucl = UserClassObject DEFAULT NULL;
	testcl = Test DEFAULT NULL;
	result = TestResult DEFAULT NULL;
	resultscnt = INTEGER NOT NULL;
    k = integer not null default 1;
enddeclare
begin
    results_tf.Clear();
    cls_arr.Clear();
	FOR i=1 TO t.CheckedNodes.LastRow DO
		n = t.CheckedNodes[i];
		comp = ReposTestObject(n.ClientData);
		IF comp IS NOT NULL THEN
			IF comp.Type = '' THEN // Application
				appsrc = cache.GetDBAppl(NULL, comp.Name, -1, -3, lockb, NULL);
				appsrc.AddToCurrentApp();
				appcnt = appcnt + 1;
				appsrc_arr[appcnt] = appsrc;
			ELSE // Class
				clscnt = clscnt + 1;
				cls_arr[clscnt].Value = comp.Type+'!'+comp.Name;
				cls_arr[clscnt].ClientData = n;
			ENDIF;
		ENDIF;
	ENDFOR;
	FOR clscnt=1 TO cls_arr.LastRow DO
		dexp = CurFrame.Scope.CreateDynExpr(string = cls_arr[clscnt].Value);
		IF dexp IS NOT NULL THEN
			dexp.GetValue(value = BYREF(ucl));
			testcl = Test(ucl.Create());
			result = TestResult.Create();
			testcl.Run(result = result);

			IF result.failures.LastRow>0 THEN   // TODO: Care about Errors later
				TreeNode(cls_arr[clscnt].ClientData).BitmapLabelIndex = 3;
				resultscnt = resultscnt + 1;
				results_tf[resultscnt].TestclassName = cls_arr[clscnt].Value;
				FOR k=1 TO result.failures.LastRow DO
					results_tf[resultscnt].errors[k] = result.failures[k].error;
				ENDFOR;
			ELSE
				TreeNode(cls_arr[clscnt].ClientData).BitmapLabelIndex = 2;
			ENDIF;
		ENDIF;
	ENDFOR;
	FOR i=1 TO appsrc_arr.LastRow DO
		appsrc_arr[i].RemoveFromCurrentApp();
	ENDFOR;
end

